@njit
def add_coor(coor0,coor1):
    return ((coor0[0] + coor1[0])%H,(coor0[1] + coor1[1])%W)
@njit    
def sub_coor(coor0,coor1):
    return ((coor0[0] - coor1[0])%H,(coor0[1] - coor1[1])%W)
@njit
def to_coor(i):
    return (i//W,i%W)#(y,x)
@njit   
def from_coor(coor):
    return coor[0]*W + coor[1]

